import "./index.scss";

export const HomeScreen = () => {
  return (
    <div className="home-container">
      <div className="left-container">
        <h1>Left container</h1>
      </div>
      <div className="right-container">
        <h1>Right container</h1>
      </div>
    </div>
  );
};
